import generateFakeData from './lib/fake.js'
import moment from 'moment'

export default function App() {
const data = generateFakeData()

console.log({ data })

return (
<main>
    {data.map(word =>
        <li>{word.name}</li>, 
            <li>{word.id}</li> )
    })}
    {moment("2015-09-29T21:45:18Z", "YYYY-MM-DD").fromNow()}

</main>
)
}
